import React from "react";

const Day25 = (props) => {
  return (
    <div className="day">
      <h2>May 25</h2>
      <h3>Can Marcer and Sitges</h3>

      <div>
        <p>Today we will be checking into the Can Marcer de la Penya in Sitges. This will be the venue for the wedding, and our home base over the next few days</p>
      </div>
    </div>
  );
};

export default Day25;
